import React, { Fragment } from "react";
import { Form, Input, Icon, Grid } from "semantic-ui-react";
import "./App.css";

function App() {
  return (
    <Fragment>
      <nav>
        <div className="logo">
          <h2>TodoList</h2>
        </div>
      </nav>
      <div className="bf">
        <Grid textAlign="center" verticalAlign="middle">
          <Grid.Column className="grid-width" >
            <Form className="form"  size="large">
            <Form.Input width={6}  required >  
              {/* <Input placeholder="Enter the task" fluid /> */}
            </Form.Input>
            <Form.Button  color="green" inverted ><Icon name="checkmark"/>Add Task</Form.Button>

            </Form>

          </Grid.Column>
        </Grid>

      </div>
    </Fragment>

    // <div>something</div>
  );
}

export default App;
